import React from 'react';
import { Switch , Route} from 'react-router-dom';
import LandingPage from './landingpage';
import About  from './about';
const Main = ()=>(
    <switch>
        <Route exact path='/' component = {LandingPage} />
        <Route path='/about' component = {About} />

    </switch>
)
export default Main;
